</o:shapelayout></xml><![endif]--></head><body lang=FR link="#0563C1" vlink="#954F72" style='word-wrap:break-word'><div class=WordSection1><p class=MsoNormal><span style='font-family:"Helvetica",sans-serif'>Chï¿½re Madame,<o:p></o:p></span></p><p class=MsoNormal><span style='font-family:"Helvetica",sans-serif'>Cher Monsieur,<o:p></o:p></span></p><p class=MsoNormal><span style='font-family:"Helvetica",sans-serif'><o:p>&nbsp;</o:p></span></p><p class=MsoNormal><span style='font-family:"Helvetica",sans-serif'>Nous souhaitons mettre en vente&nbsp;nos diffï¿½rentes publications sur notre site internet via le logiciel Weezevent. Cette dï¿½marche comprend ï¿½galement le paiement en ligne par nos clients. Ces ventes sont ï¿½ destination d&#8217;un public France et international.<o:p></o:p></span></p><p class=MsoNormal><span style='font-family:"Helvetica",sans-serif'><o:p>&nbsp;</o:p></span></p><p class=MsoNormal><span style='font-family:"Helvetica",sans-serif'>Suite ï¿½ vos ï¿½changes avec Nicolas Didon, je vous remercie de nous confirmer par ï¿½crit les ï¿½lï¿½ments suivants&nbsp;:<o:p></o:p></span></p><p class=MsoNormal><span style='font-family:"Helvetica",sans-serif'><o:p>&nbsp;</o:p></span></p><ul style='margin-top:0cm' type=disc><li class=MsoNormal style='mso-list:l0 level1 lfo1'><span style='font-family:"Helvetica",sans-serif'>Il n&#8217;y a pas de consï¿½quences fiscales pour l&#8217;EURL Archivistes franï¿½ais Formation (AFF) ï¿½ vendre ses publications en ligne et faire payer ï¿½galement en ligne ces ventes.<o:p></o:p></span></li></ul><p class=MsoNormal style='margin-left:36.0pt'><span style='font-family:"Helvetica",sans-serif'><o:p>&nbsp;</o:p></span></p><ul style='margin-top:0cm' type=disc><li class=MsoNormal style='mso-list:l0 level1 lfo1'><span style='font-family:"Helvetica",sans-serif'>Les documents comptables ï¿½mis ï¿½ partir de Weezevent et que nous vous transmettrons mensuellement sont conformes ï¿½ la lï¿½gislation et pour vous permettre d&#8217;assurer la bonne gestion de notre comptabilitï¿½.<o:p></o:p></span></li></ul><p class=MsoNormal style='margin-left:36.0pt'><span style='font-family:"Helvetica",sans-serif'>A ce sujet, nous avons bien notï¿½ que nous devrons procï¿½der au renommage des fichiers sous le numï¿½ro du compte comptable 707100 dans l&#8217;intitulï¿½. Ces fichiers vous seront par ailleurs transmis sous format PDF.)<o:p></o:p></span></p><p class=MsoNormal style='margin-left:36.0pt'><span style='font-family:"Helvetica",sans-serif'><o:p>&nbsp;</o:p></span></p><ul style='margin-top:0cm' type=disc><li class=MsoNormal style='mso-list:l0 level1 lfo1'><span style='font-family:"Helvetica",sans-serif'>Archivistes franï¿½ais Formation devra garder les 2 taux de TVA sur les factures Weezevent pour supprimer tout risque fiscal.<o:p></o:p></span></li></ul><p class=MsoNormal><span style='font-family:"Helvetica",sans-serif'><o:p>&nbsp;</o:p></span></p><p class=MsoNormal><span style='font-family:"Helvetica",sans-serif'>Bien cordialement<o:p></o:p></span></p><p class=MsoNormal><span style='font-family:"Helvetica",sans-serif'>Laurent Ducol, Gï¿½rant de l&#8217;EURL Archivistes franï¿½ais formation<o:p></o:p></span></p><p class=MsoNormal><span style='color:#1F497D'><o:p>&nbsp;</o:p></span></p><p class=MsoNormal style='mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;background:white'><span style='mso-fareast-language:FR'><o:p>&nbsp;</o:p></span></p><p class=MsoNormal><o:p>&nbsp;</o:p></p></div></body></html>
